import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
//import App from './App';
import * as serviceWorker from './serviceWorker';
import UserList from "./test";
import App from "./router";


const users = [
    {id: 1, username: "admin", firstname: 'Else', secondname: 'Form', email: "gforc@adm.com"},
    {id: 2, username: "User", firstname: 'noname', secondname: 'strange', email: "mal@mail.ru"},
]

ReactDOM.render(
   <React.StrictMode>
     <App />
   </React.StrictMode>,
   document.getElementById('root')
);

